export const morphIDText = {
  title: 'Morph - ID is an identification card with a single genetic code essential to access the game that represents the identity of your Morph that stands out in each user.',
  waysToStart: 'The game offers 2 experience scenarios based on the starting Morph ID card a player chooses. Each scenario satisfies different game modes. Classique card is more suitable for explorers and the Eternal one for true competition lovers.',
  classiqueText: 'This is the classic mode of the game where each player can start their experience immediately to learn the basic mechanics and then decide whether to switch to Eternal mode',
  eternalText: 'The Morph Eternal card allows for a full gaming experience where a player can earn in-game currency a Poligon-based cryptocurrency called Morganis',
